import React from 'react';

const VendorCard = ({ vendor }) => {
  return (
    <div className="vendor-card shadow p-3 mb-4 rounded" style={{ border: '1px solid #ddd' }}>
      <h3>{vendor.dispensaryName}</h3>
      <p>{vendor.businessAddress.street}, {vendor.businessAddress.city}</p>
      <p>Rating: {vendor.rating || 'N/A'}</p>
      <p>Minimum Order: ${vendor.minOrder || 'N/A'}</p>
      <div className="products-preview">
        {vendor.products?.length ? (
          vendor.products.slice(0, 3).map((product) => (
            <div key={product._id} className="product-preview">
              <p>{product.name}</p>
              <p>${product.price}</p>
            </div>
          ))
        ) : (
          <p>No products available</p>
        )}
      </div>
      <button className="btn btn-primary mt-2">View More</button>
    </div>
  );
};

export default VendorCard;
